import Nav from 'react-bootstrap/Nav';
import './Navbar.css'

function Navbar() {
    return (
        <Nav variant="tabs" defaultActiveKey="/home">
            <div variant="container">
                <Nav.Item>
                    <h2>Where is the end</h2>
                </Nav.Item>
            </div>

        </Nav>
    );
}

export default Navbar;
